import React from 'react';

const UserList = ({ users, editUser, deleteUser }) => {
  return (
    <ul className="text-yellow">
      {users.map((user) => (
        <li key={user.id}>
          <div>Name: {user.name}</div>
          <div>Email: {user.email}</div>
          <div>Phone: {user.phone}</div>
          <button className="bg-blue-400 gap-x-px "  onClick={() => editUser(user)}>Edit</button>
          <button className="bg-blue-400 " onClick={() => deleteUser(user.id)}>Delete</button>
        </li>
      ))}
    </ul>
  );
};

export default UserList;
